import { createDrawerNavigator } from "@react-navigation/drawer";
import { NavigationContainer, Theme } from "@react-navigation/native";
import DrawerList from "./DrawerList";
import Books from "../Screen/Books";
import Fantastics from "../Screen/Fantastics";
import General from "../Screen/General";

const DrawerElement = createDrawerNavigator<DrawerList>();

type props = {
  theme: Theme;
  token: string;
};

export type params = {
  token: string;
};

export default function Drawer(props: props) {
  return (
    <NavigationContainer theme={props.theme} key="Index">
      <DrawerElement.Navigator initialRouteName="Books">
        <DrawerElement.Screen
          name="Books"
          component={Books}
          initialParams={{ token: props.token, updated: 0 }}
        />
        <DrawerElement.Screen
          name="Fantastics"
          component={General}
          initialParams={{ token: props.token }}
        />
        <DrawerElement.Screen
          name="Fantastic"
          component={Fantastics}
          initialParams={{ token: props.token }}
          options={{
            drawerItemStyle: { display: "none" },
          }}
        />
      </DrawerElement.Navigator>
    </NavigationContainer>
  );
}
